// Structure definitions
typedef struct {
    int x; // x Location
    int y; // y location
    int bombRadius; // default 1
    int moveSpeed; // 
    int bombNum; // max bombs player can place at once
    int bombsPlaced; // 
    int colour; // colour of player
    int middleX; // middle of player. gonna be x + HALF_OF_PLAYER
    int middleY;
    int curBlockX; // the x of the current block player is on
    int curBlockY; 
    int bombID; 
    int BlockX; // block location
    int BlockY;
    int bombArrX[MAX_BOMBS]; // stores X location of bomb.
    int bombArrY[MAX_BOMBS]; // stores Y location of bomb. 
    int bombTimer[MAX_BOMBS]; // stores timers for bombs. 
    int dead; // if 1 you are dead
} Player;

Player p1; // at most we have 2 players
Player p2; 

